import React, { useState } from "react";

const AddStudents = () => {


    return (
        <div>
            <header>
                <h1>Add Students Information</h1>
            </header>
            <main>
                <form action="/">
                    <div>
                        <label>Name: </label>
                        <input type="text" name="stuname" placeholder="Enter Name" />
                    </div>
                    <div>
                    <label>Age: </label>
                    <input type="number" name="age" />
                    </div>
                </form>
            </main>
        </div>
    );
}
export default AddStudents;
